import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import ComponentBar from './componentBar';
import AppBarBasic from '../components/AppBar/appBarBasic'
import LandingBasic from '../components/Landing/landingBasic';
import CardContainerComplex from '../containers/cardContainerComplex';
import CardContainerTestimonial from '../containers/cardContainerTestimonial';
import FooterBasic from '../components/Footer/footerBasic';
import { connect } from 'react-redux'
const mapStateToProps = (state) => ({
    creatorComponentsData: state.applicationManager.creatorComponentsData
})
const useStyle = makeStyles(theme => ({
    root: {
        padding: '1em'
    }
}))
function ComponentsContainer(props){
    const classes = useStyle()
    console.log(props.creatorComponentsData)
    return (
        <div className={classes.root}>
            <ComponentBar name='Appbar Basic' />
            <AppBarBasic />
            <ComponentBar name='Landing Basic' />
            <LandingBasic />
            <ComponentBar name='Card Container Complex' />
            <CardContainerComplex />
            <ComponentBar name='Card Container Testimonial' />
            <CardContainerTestimonial />
            <ComponentBar name='Footer Basic' />
            <FooterBasic />
        </div>
    )
}
export default connect(mapStateToProps)(ComponentsContainer)
